import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useAuth } from '../utils/auth';
import '../styles.css';

export default function CandidateDashboard() {
  const { token, user, logout } = useAuth();
  const [list, setList] = useState([]);

  useEffect(() => {
    fetchList();
  }, []);

  async function fetchList() {
    const res = await axios.get(
      (process.env.REACT_APP_API || 'http://localhost:5000') + '/api/interviews',
      { headers: { Authorization: 'Bearer ' + token } }
    );
    setList(res.data);
  }

  const upcoming = list.filter(
    (i) => i.status === 'scheduled' && new Date(i.datetime) > new Date()
  );
  const completed = list.filter((i) => i.status === 'completed');

  return (
    <div className="dashboard-page">
      <header className="topbar">
        <h1>Candidate Dashboard</h1>
        <button onClick={logout} className="btn-primary logout-btn">
          Logout
        </button>
      </header>

      <div className="dashboard-card">
        <div className="stats">
          <div className="stat-box">
            <h3>Upcoming</h3>
            <p>{upcoming.length}</p>
          </div>
          <div className="stat-box">
            <h3>Completed</h3>
            <p>{completed.length}</p>
          </div>
        </div>

        <section className="interview-section">
          <h2>Upcoming Interviews</h2>
          {upcoming.length === 0 && (
            <div className="muted">No upcoming interviews</div>
          )}
          {upcoming.map((iv) => (
            <div className="interview-card" key={iv._id}>
              <div>
                <strong>{iv.position}</strong>
                <div className="muted">
                  {new Date(iv.datetime).toLocaleString()}
                </div>
              </div>
              <div>
                <div className="muted">Interviewer: {iv.interviewer?.name}</div>
                <div className="pass">
                  Passcode: <b>{iv.passcode}</b>
                </div>
              </div>
            </div>
          ))}
        </section>

        <section className="interview-section">
          <h2>Past Interviews</h2>
          {completed.length === 0 && (
            <div className="muted">No completed interviews</div>
          )}
          {completed.map((iv) => (
            <div className="interview-card" key={iv._id}>
              <div>
                <strong>{iv.position}</strong>
                <div className="muted">
                  {new Date(iv.datetime).toLocaleString()}
                </div>
              </div>
              <div>
                {iv.feedback?.map((f) => (
                  <div key={f._id}>
                    <b>{f.rating}</b> â€” {f.comments}
                  </div>
                ))}
              </div>
            </div>
          ))}
        </section>
      </div>
    </div>
  );
}
